import React from 'react'
import {Link} from "react-router-dom"
import Accordion from 'react-bootstrap/Accordion';

const numKeys = ["%", "CE", "C", "←", "1/x", "x²", "√x", "÷", "7", "8", "9", "×", "4", "5", "6", "-", "1", "2", "3", "+", "+/-", "0", ".", "="];
let listBut = [];
for(let i =0;i<numKeys.length;i++){
    listBut.push( <button className='buttonKey' value={numKeys[i]}><p className='textButton'>{numKeys[i]}</p></button>);
}

export const MainPage = () => {
  return (
    <div className='Content'>
        <div className='logo'></div>
        <p className='Title'>Standart</p>
        <input className='Screen' type='text'></input>
        <div className='Item'>{listBut}</div>
    </div>
  )
}
